    Symbols.prototype.storeAllSym = function(d, flow) {
        syms.forEach((sym) => {
            this.storeSymbol(sym.d, sym.name);
        })
    };
    //シンボルの登録
    Symbols.prototype.storeSymbol = function(symdata, id, mag) {
        var id = (!id) ? 'symbol' : id;
        var symdef = this.getSymbolDef(id)
        if(symdef==null){
        	return
        }
        if (symdef.elm == 'image') {
            return this.def.append('image').attr("id", id)
                .attr('xlink:href', symdef.path)
                .attr('transform', symdef.transform)
        }
        return this.def.append('path').attr("id", id)
            .attr('d', symdata.d)
            // .attr('transform', 'translate(-25,-25) scale(' + symdata.scale + ') ')
            .attr('transform', symdef.transform)
            .attr('fill', symdata.color)
            // .attr('opacity', "0.7")
    };
    //動くシンボルの登録
    Symbols.prototype.storeSymbolFlow = function(sym, id) {
        if (!this.def.selectAll('#path1')[0].length > 0) {
            this.def.append('path').attr("id", "path1").attr('d', 'M0,0 v 10 v-10');
        }
        return this.storeSymbol(sym, id).append('animateMotion').attr({
            dur: "2s",
            repeatCount: "indefinite",
            rotate: "none"
        }).append('mpath').attr('xlink:href', "#path1");
    };
    //利用
    Symbols.prototype.appendSymbol = function(sel, metrix, mag) {
        var self = this
        var metrix = (!metrix) ? 'symbol' : metrix;
        return sel.append('use').attr('xlink:href', function(d) {
            var id = (self.isExistSymbol(d[metrix])) ? d[metrix] : 'none'
            return '../../../../../../frame.html#' + id
        })
    };
    Symbols.prototype.isExistSymbol = function(symbolId) {
        for (var i = syms.length - 1; i >= 0; i--) {
            if (syms[i].name == symbolId) {
                return true
            }
        }
        return false
    }
    Symbols.prototype.getSymbolDef = function(symbolId) {
        for (var i = syms.length - 1; i >= 0; i--) {
            if (syms[i].name == symbolId) {
                return syms[i]
            }
        }
        //該当なければ一番はじめのを返す
        return null
    }
